  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '功能名称',
  `value` varchar(50) DEFAULT NULL COMMENT '功能标识',
  `selected` int(11) DEFAULT '0' COMMENT '默认选中',
  `status` int(11) DEFAULT '1' COMMENT '0隐藏，1显示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='客户功能表';


DROP TABLE IF EXISTS `ws_config`;
CREATE TABLE `ws_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '参数标识',
  `memo` varchar(255) DEFAULT NULL COMMENT '参数说明',
  `content` text COMMENT '参数值',
  `type` varchar(255) DEFAULT NULL COMMENT '参数填写方式，file上传图片，color选择颜色，textarea文本域|占位符，[radio|checkbox|select|switch]|值1:字1#值2:字2，input文本框(默认)|占位符',
  `parent_id` int(11) DEFAULT '0' COMMENT '父id(供switch用)',
  `parent_value` varchar(255) DEFAULT NULL COMMENT '分组依据(父值,供switch用)',
  `status` int(11) DEFAULT '1' COMMENT '0隐藏，1显示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 COMMENT='客户全局参数表';


DROP TABLE IF EXISTS `ws_country`;
CREATE TABLE `ws_country` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) DEFAULT NULL COMMENT '国家名称',
  `name_english` varchar(250) DEFAULT NULL COMMENT '英文名称',
  `detail_pic` varchar(250) DEFAULT NULL COMMENT '国家馆详情页的图片，上传到又拍云',
  `list_pic_big` varchar(250) DEFAULT NULL COMMENT '列表的大图（一行显示），上传到又拍云',
  `list_pic_small` varchar(250) DEFAULT NULL COMMENT '列表的小图（一行两个），上传到又拍云',
  `flag_pic` varchar(250) DEFAULT NULL COMMENT '国家的旗帜图标，上传到又拍云',
  `memo` varchar(250) DEFAULT NULL COMMENT '备注',
  `sort` int(11) DEFAULT '999' COMMENT '数字越小，排在越前',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `status` int(11) DEFAULT '0' COMMENT '1正常，0隐藏',
  `clicks` int(11) DEFAULT '0' COMMENT '点击次数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=36 DEFAULT CHARSET=utf8 COMMENT='国家馆表';


DROP TABLE IF EXISTS `ws_coupon`;
CREATE TABLE `ws_coupon` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) DEFAULT '0' COMMENT '店铺id',
  `name` varchar(11) DEFAULT NULL COMMENT '优惠券名称',
  `coupon_money` decimal(10,2) DEFAULT '0.00' COMMENT '优惠形式，金额，-1抵扣全额',
  `coupon_discount` decimal(10,2) DEFAULT '0.00' COMMENT '优惠形式，折扣，-1抵扣全额',
  `position` int(11) DEFAULT '1' COMMENT '使用位置，1通用，2app专享，3微信专享，4app+微信专享',
  `min_price` decimal(10,2) DEFAULT '0.00' COMMENT '使用条件，0无条件使用，>0订单金额达到该金额的时候可以使用',
  `begin_time` int(11) DEFAULT '0' COMMENT '优惠券有效时间，开始前，买家只能领取不能使用',
  `end_time` int(11) DEFAULT '0' COMMENT '优惠券有效结束时间',
  `handy_time` int(11) DEFAULT '0' COMMENT '获取后该天数内有效',
  `quantity` int(11) DEFAULT '0' COMMENT '发放数量',
  `auto_add` int(11) DEFAULT '0' COMMENT '自动增加',
  `num_per_person` int(11) DEFAULT '1' COMMENT '每人限领数量',
  `times` int(11) DEFAULT '1' COMMENT '可用次数，-1无限次',
  `day_times` int(11) DEFAULT '0' COMMENT '一天内可用次数，0不限次',
  `status` int(11) DEFAULT '1' COMMENT '状态，-2过期，-1已使用，0隐藏，1正常',
  `offline_use` int(11) DEFAULT '0' COMMENT '1线下专用，0线上线下通用',
  `permit_goods` int(11) DEFAULT '0' COMMENT '使用范围，0所有商品，1指定',
  `type` int(11) DEFAULT '0' COMMENT '类型，0商品，1品牌，2新人注册',
  `pic` varchar(255) DEFAULT NULL COMMENT '图片',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='优惠券表';


DROP TABLE IF EXISTS `ws_coupon_goods`;
CREATE TABLE `ws_coupon_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `coupon_id` int(11) DEFAULT '0' COMMENT '优惠券id',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='优惠券商品表';


DROP TABLE IF EXISTS `ws_coupon_history`;
CREATE TABLE `ws_coupon_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `coupon_sn_id` int(11) DEFAULT '0' COMMENT '已发行优惠券id',
  `add_time` int(11) DEFAULT '0' COMMENT '使用时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='优惠券使用历史';


DROP TABLE IF EXISTS `ws_coupon_sn`;
CREATE TABLE `ws_coupon_sn` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '领取人',
  `coupon_id` int(11) DEFAULT '0' COMMENT '优惠券id',
  `sn` varchar(100) DEFAULT NULL COMMENT '优惠券编号',
  `coupon_money` decimal(10,2) DEFAULT '0.00' COMMENT '优惠券面值，将面值固化在这，即使重新编辑优惠券的面值，也不影响已发放的优惠券',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `get_time` int(11) DEFAULT '0' COMMENT '领取时间',
  `use_time` int(11) DEFAULT '0' COMMENT '使用时间',
  `times` int(11) DEFAULT '1' COMMENT '剩余使用次数，-1无限次',
  `status` int(11) DEFAULT '1' COMMENT '1正常，0无效，-1已使用，-2过期',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=400 DEFAULT CHARSET=utf8 COMMENT='已发行的优惠券表';


DROP TABLE IF EXISTS `ws_debug`;
CREATE TABLE `ws_debug` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `header` text COMMENT '请求头',
  `data` text COMMENT '内容',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='DEBUG收集表';


DROP TABLE IF EXISTS `ws_district`;
CREATE TABLE `ws_district` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `district_id` int(11) DEFAULT '0' COMMENT '区县id',
  `name` varchar(20) DEFAULT NULL COMMENT '名称',
  `parent_id` int(11) DEFAULT '0' COMMENT '上级id',
  PRIMARY KEY (`id`),
  KEY `district_id` (`district_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3157 DEFAULT CHARSET=utf8 COMMENT='区县表';


DROP TABLE IF EXISTS `ws_favorite`;
CREATE TABLE `ws_favorite` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `item_id` int(11) DEFAULT '0' COMMENT '收藏内容的id，通过此id，关联到文章表、商品表、门店表、会员表等',
  `type_id` int(11) DEFAULT '0' COMMENT '藏的内容类型，1商品，2店铺，3国家，4发现，5会员',
  `add_time` int(11) DEFAULT '0' COMMENT '收藏时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='收藏表';


DROP TABLE IF EXISTS `ws_feedback`;
CREATE TABLE `ws_feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `type_id` int(11) DEFAULT '0' COMMENT '0反馈，1举报',
  `name` varchar(20) DEFAULT NULL COMMENT '昵称',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `content` varchar(1000) DEFAULT NULL COMMENT '反馈内容',
  `ip` varchar(15) DEFAULT NULL COMMENT 'ip地址',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='反馈表';


DROP TABLE IF EXISTS `ws_goods`;
CREATE TABLE `ws_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `name` varchar(250) DEFAULT NULL COMMENT '商品名称',
  `model` varchar(250) DEFAULT NULL COMMENT '商品型号',
  `pic` varchar(1000) DEFAULT NULL COMMENT '主图',
  `ad_pic` varchar(1000) DEFAULT NULL COMMENT '广告图',
  `poster_pic` varchar(1000) DEFAULT NULL COMMENT '封面图',
  `description` varchar(500) DEFAULT NULL COMMENT '商品简要描述 ',
  `type` int(11) DEFAULT '0' COMMENT '商品类型，0实物商品，1虚拟商品，2电子卡券，3酒店商品，4蛋糕烘焙(外卖)',
  `keywords` varchar(250) DEFAULT NULL COMMENT '商品关键词',
  `content` text COMMENT '商品详情',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '价格',
  `market_price` decimal(10,2) DEFAULT '0.00' COMMENT '市场价',
  `cost_price` decimal(10,2) DEFAULT '0.00' COMMENT '成本价，不在前台显示',
  `promote_price` decimal(10,2) DEFAULT '0.00' COMMENT '促销价',
  `promote_begin_time` int(11) DEFAULT '0' COMMENT '促销开始日期，0不限制',
  `promote_end_time` int(11) DEFAULT '0' COMMENT '促销结束日期，0不限制',
  `groupbuy_price` decimal(10,2) DEFAULT '0.00' COMMENT '拼团价',
  `groupbuy_begin_time` int(11) DEFAULT '0' COMMENT '拼团开始时间',
  `groupbuy_end_time` int(11) DEFAULT '0' COMMENT '拼团结束时间',
  `groupbuy_amount` int(11) DEFAULT '0' COMMENT '拼团数量',
  `groupbuy_count` int(11) DEFAULT '0' COMMENT '已拼团数量',
  `groupbuy_number` int(11) DEFAULT '0' COMMENT '成团人数',
  `groupbuy_time` int(11) DEFAULT '24' COMMENT '成团限时，单位小时',
  `groupbuy_limit` int(11) DEFAULT '0' COMMENT '每人限拼数量，0不限制',
  `groupbuy_free_shipping` int(11) DEFAULT '0' COMMENT '拼团时包邮',
  `purchase_price` decimal(10,2) DEFAULT '0.00' COMMENT '秒杀价',
  `purchase_begin_time` int(11) DEFAULT '0' COMMENT '秒杀开始时间',
  `purchase_end_time` int(11) DEFAULT '0' COMMENT '秒杀结束时间',
  `purchase_amount` int(11) DEFAULT '0' COMMENT '秒杀数量',
  `purchase_count` int(11) DEFAULT '0' COMMENT '已秒杀数量',
  `purchase_limit` int(11) DEFAULT '0' COMMENT '每人限秒数量，0不限制',
  `purchase_free_shipping` int(11) DEFAULT '0' COMMENT '秒杀时包邮',
  `chop_price` decimal(10,2) DEFAULT '0.00' COMMENT '砍价最低价，0免费',
  `chop_begin_time` int(11) DEFAULT '0' COMMENT '砍价开始时间',
  `chop_end_time` int(11) DEFAULT '0' COMMENT '砍价结束时间',
  `chop_num` int(11) DEFAULT '5' COMMENT '至少需要砍刀数',
  `chop_amount` int(11) DEFAULT '0' COMMENT '砍价数量',
  `chop_count` int(11) DEFAULT '0' COMMENT '已砍价数量',
  `chop_time` int(11) DEFAULT '24' COMMENT '砍价限时，单位小时',
  `chop_free_shipping` int(11) DEFAULT '0' COMMENT '砍价时包邮',
  `category_id` int(11) DEFAULT '0' COMMENT '所属分类',
  `shop_id` int(11) DEFAULT '0' COMMENT '商品所属店铺',
  `brand_id` int(11) DEFAULT '0' COMMENT '所属品牌',
  `country_id` int(11) DEFAULT '0' COMMENT '国家馆id',
  `integral` int(11) DEFAULT '0' COMMENT '购买该商品所需要的积分',
  `give_integral` int(11) DEFAULT '0' COMMENT '购买成功后，赠送的积分数量',
  `sales` int(11) DEFAULT '0' COMMENT '销量',
  `clicks` int(11) DEFAULT '0' COMMENT '人气',
  `stocks` int(11) DEFAULT '100' COMMENT '库存',
  `stock_alert_number` int(11) DEFAULT '10' COMMENT '库存报警数量',
  `longitude` double DEFAULT '0' COMMENT '经度',
  `latitude` double DEFAULT '0' COMMENT '纬度',
  `comments` int(11) DEFAULT '0' COMMENT '评价人数',
  `params` varchar(1000) DEFAULT NULL COMMENT '参数',
  `ext_property` varchar(50) DEFAULT NULL COMMENT '扩展属性，逗号隔开，1推荐，2热销，3精品，4新品，5折扣',
  `free_shipping` int(11) DEFAULT '0' COMMENT '是否包邮，1是，0否',
  `shipping_fee` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `shipping_fee_id` int(11) DEFAULT '0' COMMENT '运费模板id',
  `weight` decimal(10,2) DEFAULT '0.00' COMMENT '重量kg',
  `free_shipping_count` int(11) DEFAULT '0' COMMENT '购买n件起包邮',
  `commission_type` int(11) DEFAULT '0' COMMENT '佣金分利类型，0关闭，1百分比，2固定金额',
  `commissions` varchar(250) DEFAULT NULL COMMENT '佣金分利，值为数字，且逗号隔开',
  `edit_time` int(11) DEFAULT '0' COMMENT '编辑（重新上架）时间',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `release_time` int(11) DEFAULT '0' COMMENT '自定义上架时间',
  `seller_note` varchar(250) DEFAULT NULL COMMENT '商家备注，只有商家才能看到',
  `sort` int(11) DEFAULT '999' COMMENT '数字越小，排在越前',
  `status` int(11) DEFAULT '1' COMMENT '状态，1正常，0下架，-1自定义上架时间',
  `in_shop` int(11) DEFAULT '0' COMMENT '线下门店是否有销售，1是，0否',
  `sale_method` int(11) DEFAULT '0' COMMENT '销售模式，0海外直采，1保税直发',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=351 DEFAULT CHARSET=utf8 COMMENT='商品表';


DROP TABLE IF EXISTS `ws_goods_category`;
CREATE TABLE `ws_goods_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) DEFAULT NULL COMMENT '分类名称',
  `parent_id` int(11) DEFAULT '0' COMMENT '父级id',
  `pic` varchar(250) DEFAULT NULL COMMENT '分类图片',
  `memo` varchar(500) DEFAULT NULL COMMENT '备注',
  `keywords` varchar(250) DEFAULT NULL COMMENT '关键词',
  `status` int(11) DEFAULT '1' COMMENT '0隐藏，1正常',
  `sort` int(11) DEFAULT '999' COMMENT '数字越小，排在越前',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=90 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='商品分类表';


DROP TABLE IF EXISTS `ws_goods_grade_price`;
CREATE TABLE `ws_goods_grade_price` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `grade_id` int(11) DEFAULT '0' COMMENT '等级id',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '价格',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品会员等级价格表';


DROP TABLE IF EXISTS `ws_goods_keyword`;
CREATE TABLE `ws_goods_keyword` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `keyword` varchar(50) DEFAULT NULL COMMENT '关键词',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8 COMMENT='商品关键词表';


DROP TABLE IF EXISTS `ws_goods_pic`;
CREATE TABLE `ws_goods_pic` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `pic` varchar(1000) DEFAULT NULL COMMENT '图片路径',
  `video` varchar(1000) DEFAULT NULL COMMENT '视频路径',
  `memo` varchar(1000) DEFAULT NULL COMMENT '图片说明、名称',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7380 DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='商品图片表';


DROP TABLE IF EXISTS `ws_goods_spec`;
CREATE TABLE `ws_goods_spec` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `spec` varchar(500) DEFAULT NULL COMMENT '规格id树，逗号隔开',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '价格',
  `promote_price` decimal(10,2) DEFAULT '0.00' COMMENT '促销价',
  `groupbuy_price` decimal(10,2) DEFAULT '0.00' COMMENT '拼团价',
  `purchase_price` decimal(10,2) DEFAULT '0.00' COMMENT '秒杀价',
  `chop_price` decimal(10,2) DEFAULT '0.00' COMMENT '砍价',
  `stocks` int(11) DEFAULT '0' COMMENT '库存',
  `pic` varchar(1000) DEFAULT NULL COMMENT '规格图片',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1463 DEFAULT CHARSET=utf8 COMMENT='商品规格表';


DROP TABLE IF EXISTS `ws_goods_spec_category`;
CREATE TABLE `ws_goods_spec_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) DEFAULT '0' COMMENT '店铺id',
  `name` varchar(50) DEFAULT NULL COMMENT '名称',
  `parent_id` int(11) DEFAULT '0' COMMENT '父id，0规格名，>0规格值',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8 COMMENT='商品规格分类表';


DROP TABLE IF EXISTS `ws_goods_spec_linkage`;
CREATE TABLE `ws_goods_spec_linkage` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `spec_id` int(11) DEFAULT '0' COMMENT '规格id',
  `parent_id` int(11) DEFAULT '0' COMMENT '规格父id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=735 DEFAULT CHARSET=utf8 COMMENT='商品规格分类联动表';


DROP TABLE IF EXISTS `ws_grade`;
CREATE TABLE `ws_grade` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) DEFAULT NULL COMMENT '等级名称',
  `pic` varchar(250) DEFAULT NULL COMMENT '图片',
  `memo` text COMMENT '备注',
  `score` int(11) DEFAULT '0' COMMENT '所需积分',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '价格',
  `status` int(11) DEFAULT '1' COMMENT '状态：1正常，0隐藏',
  `sort` int(11) DEFAULT '999' COMMENT '数字越小，排在越前',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='会员等级表';


DROP TABLE IF EXISTS `ws_grade_order`;
CREATE TABLE `ws_grade_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `grade_id` int(11) DEFAULT '0' COMMENT '等级id',
  `order_sn` varchar(50) DEFAULT NULL COMMENT '订单号',
  `total_price` decimal(10,2) DEFAULT '0.00' COMMENT '总价',
  `pay_method` varchar(20) DEFAULT NULL COMMENT 'alipay/wxpay/wxpay_h5/wxpay_mini',
  `client_type` int(11) DEFAULT '0' COMMENT '客户端类型，0网页，1小程序，2iOS，3Android',
  `trade_no` varchar(250) DEFAULT NULL COMMENT '外部订单号',
  `total_fee` decimal(10,2) DEFAULT '0.00' COMMENT '支付金额',
  `pay_time` int(11) DEFAULT '0' COMMENT '支付时间',
  `is_mini` int(11) DEFAULT '0' COMMENT '0普通订单，1小程序订单',
  `status` int(11) DEFAULT '0' COMMENT '0未支付，1支付成功',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='等级支付表';


DROP TABLE IF EXISTS `ws_launch_image`;
CREATE TABLE `ws_launch_image` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `pic` varchar(200) DEFAULT NULL COMMENT '图片网址',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='APP启动图';


DROP TABLE IF EXISTS `ws_member`;
CREATE TABLE `ws_member` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(100) DEFAULT NULL COMMENT '用户名称',
  `password` varchar(128) DEFAULT NULL COMMENT '密码，加密后',
  `origin_password` varchar(64) DEFAULT NULL COMMENT '密码，明文',
  `salt` varchar(6) DEFAULT NULL COMMENT '盐值',
  `sign` varchar(128) DEFAULT NULL COMMENT '签名',
  `session_id` varchar(100) DEFAULT NULL COMMENT 'session_id',
  `withdraw_password` varchar(128) DEFAULT NULL COMMENT '提现密码',
  `withdraw_salt` varchar(6) DEFAULT NULL COMMENT '提现盐值',
  `real_name` varchar(50) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '真实姓名',
  `mobile` varchar(50) DEFAULT NULL COMMENT '手机',
  `code` varchar(128) DEFAULT NULL COMMENT '唯一码',
  `reg_time` int(11) DEFAULT '0' COMMENT '注册时间',
  `reg_ip` varchar(50) DEFAULT NULL COMMENT '注册ip',
  `last_time` int(11) DEFAULT '0' COMMENT '上次登录时间',
  `last_ip` varchar(50) DEFAULT NULL COMMENT '上次登录ip',
  `logins` int(11) DEFAULT '0' COMMENT '登录次数',
  `member_type` int(11) DEFAULT '1' COMMENT '会员类型，1普通会员，2门店店员，3店长',
  `card_sn` varchar(250) DEFAULT NULL COMMENT '会员卡号',
  `experience` int(11) DEFAULT '0' COMMENT '经验值',
  `avatar` varchar(1000) DEFAULT NULL COMMENT '头像',
  `udid` varchar(250) DEFAULT NULL COMMENT '手机udid',
  `badge` int(11) DEFAULT '0' COMMENT 'APP角标数字',
  `wechat` varchar(50) DEFAULT NULL COMMENT '微信号',
  `qq` varchar(50) DEFAULT NULL COMMENT 'QQ号',
  `idcard` varchar(50) DEFAULT NULL COMMENT '身份证号码',
  `alipay` varchar(50) DEFAULT NULL COMMENT '支付宝账号',
  `status` int(11) DEFAULT '0' COMMENT '0冻结，1正常',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '余额',
  `commission` decimal(10,2) DEFAULT '0.00' COMMENT '佣金',
  `commission_total` decimal(10,2) DEFAULT '0.00' COMMENT '总收益',
  `integral` int(11) DEFAULT '0' COMMENT '积分',
  `invite_code` varchar(50) DEFAULT NULL COMMENT '邀请码',
  `nick_name` varchar(250) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '昵称',
  `sex` varchar(50) DEFAULT NULL COMMENT '性别',
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `district` varchar(50) DEFAULT NULL COMMENT '区',
  `town` varchar(50) DEFAULT NULL COMMENT '街道',
  `birth_year` int(11) DEFAULT '0' COMMENT '出生年',
  `birth_month` int(11) DEFAULT '0' COMMENT '出生月',
  `birth_day` int(11) DEFAULT '0' COMMENT '出生日',
  `remark` varchar(200) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '个性签名',
  `parent_id` int(11) DEFAULT '0' COMMENT '我的邀请人',
  `grade_id` int(11) DEFAULT '0' COMMENT '会员等级',
  `grade_score` int(11) DEFAULT '0' COMMENT '等级积分',
  `grade_time` int(11) DEFAULT '0' COMMENT '等级开始时间',
  `grade_endtime` int(11) DEFAULT '0' COMMENT '等级结束时间',
  `shopowner_id` int(11) DEFAULT '0' COMMENT '所属店长id',
  `belong_shop_id` int(11) DEFAULT '0' COMMENT '店长所属门店',
  `from_shop_id` int(11) DEFAULT '0' COMMENT '从哪个体验店进入',
  PRIMARY KEY (`id`),
  KEY `name` (`name`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='会员表';


DROP TABLE IF EXISTS `ws_member_bank`;
CREATE TABLE `ws_member_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `bank_name` varchar(250) DEFAULT NULL COMMENT '银行名称',
  `bank_branch` varchar(250) DEFAULT NULL COMMENT '支行名称',
  `bank_card` varchar(250) DEFAULT NULL COMMENT '银行卡号',
  `name` varchar(250) DEFAULT NULL COMMENT '真实姓名',
  `address` varchar(250) DEFAULT NULL COMMENT '开户地区',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='银行账户表';


DROP TABLE IF EXISTS `ws_member_chop`;
CREATE TABLE `ws_member_chop` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT '0' COMMENT '订单id',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `chop_end_time` int(11) DEFAULT '0' COMMENT '砍价结束时间',
  `chop_time` int(11) DEFAULT '0' COMMENT '砍价限时，单位小时',
  `chop_num` int(11) DEFAULT '5' COMMENT '至少砍刀数',
  `num` int(11) DEFAULT '0' COMMENT '已砍刀数',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '底价',
  `remain_price` decimal(10,2) DEFAULT '0.00' COMMENT '剩余价格',
  `status` int(11) DEFAULT '0' COMMENT '状态，0砍价中，1砍价成功，-1砍价失败',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `readed` int(11) DEFAULT '0' COMMENT '是否已读',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=19 DEFAULT CHARSET=utf8 COMMENT='砍价表';


DROP TABLE IF EXISTS `ws_member_chop_list`;
CREATE TABLE `ws_member_chop_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `parent_id` int(11) DEFAULT '0' COMMENT '发起砍价主id',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '砍掉价格',
  `memo` varchar(200) DEFAULT NULL COMMENT '说明',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='砍价协助表';


DROP TABLE IF EXISTS `ws_member_commission`;
CREATE TABLE `ws_member_commission` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `commission` decimal(10,2) DEFAULT NULL COMMENT '佣金金额',
  `memo` varchar(250) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '佣金收入来源',
  `type` int(11) DEFAULT '0' COMMENT '产生来源，1订单，2充值，3注册邀请',
  `parent_id` int(11) DEFAULT '0' COMMENT '产生的id',
  `status` int(11) DEFAULT '1' COMMENT '-1退款，0冻结，1正常（已到会员）',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='会员佣金表';


DROP TABLE IF EXISTS `ws_member_goods_history`;
CREATE TABLE `ws_member_goods_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `goods_id` int(11) DEFAULT '0' COMMENT '产品id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1902 DEFAULT CHARSET=utf8 COMMENT='产品浏览历史';


DROP TABLE IF EXISTS `ws_member_groupbuy`;
CREATE TABLE `ws_member_groupbuy` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT '0' COMMENT '订单id',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `parent_id` int(11) DEFAULT '0' COMMENT '拼团表id，0为主团',
  `groupbuy_end_time` int(11) DEFAULT '0' COMMENT '拼团结束时间',
  `groupbuy_time` int(11) DEFAULT '0' COMMENT '成团限时，单位小时',
  `status` int(11) DEFAULT '0' COMMENT '状态，0拼团中，1拼团成功，-1拼团失败',
  `memo` varchar(200) DEFAULT NULL COMMENT '备注',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COMMENT='拼团表';


DROP TABLE IF EXISTS `ws_member_integral_history`;
CREATE TABLE `ws_member_integral_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `integral` int(11) DEFAULT '0' COMMENT '积分',
  `memo` varchar(250) DEFAULT NULL COMMENT '使用备注',
  `parent_id` int(11) DEFAULT '0' COMMENT '消费积分的积分商城订单id',
  `status` int(11) DEFAULT '1' COMMENT '0返回，1正常',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='积分变动明细';


DROP TABLE IF EXISTS `ws_member_money_history`;
CREATE TABLE `ws_member_money_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `money` decimal(10,2) DEFAULT NULL COMMENT '余额金额',
  `memo` varchar(250) DEFAULT NULL COMMENT '使用说明',
  `type` int(11) DEFAULT '0' COMMENT '产生来源，1订单，2充值，3注册邀请',
  `parent_id` int(11) DEFAULT '0' COMMENT '产生的id',
  `status` int(11) DEFAULT '1' COMMENT '0返回，1正常',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8 COMMENT='余额变动明细';


DROP TABLE IF EXISTS `ws_member_recharge`;
CREATE TABLE `ws_member_recharge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `recharge_id` int(11) DEFAULT '0' COMMENT '充值模板id',
  `price` decimal(10,2) DEFAULT NULL COMMENT '充值的金额',
  `recharged_money` decimal(10,2) DEFAULT NULL COMMENT '获得的总金额',
  `bonus` decimal(10,2) DEFAULT NULL COMMENT '赠送的金额',
  `add_time` int(11) DEFAULT '0' COMMENT '充值时间',
  `expired_time` int(11) DEFAULT '0' COMMENT '过期时间',
  `status` int(11) DEFAULT NULL COMMENT '0未支付，1支付成功',
  `order_sn` varchar(50) DEFAULT NULL COMMENT '订单号',
  `pay_method` varchar(50) DEFAULT NULL COMMENT 'alipay/wxpay/wxpay_h5/wxpay_mini',
  `client_type` int(11) DEFAULT '0' COMMENT '客户端类型，0网页，1小程序，2iOS，3Android',
  `trade_no` varchar(250) DEFAULT NULL COMMENT '外部订单号',
  `total_fee` decimal(10,2) DEFAULT '0.00' COMMENT '支付金额',
  `pay_time` int(11) DEFAULT '0' COMMENT '支付时间',
  `is_mini` int(11) DEFAULT '0' COMMENT '0普通订单，1小程序订单',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员充值表';


DROP TABLE IF EXISTS `ws_member_sign`;
CREATE TABLE `ws_member_sign` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `times` int(11) DEFAULT '0' COMMENT '连续第几次',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 COMMENT='签到';


DROP TABLE IF EXISTS `ws_member_sign_history`;
CREATE TABLE `ws_member_sign_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `score` int(11) DEFAULT '0' COMMENT '获得积分',
  `memo` varchar(500) DEFAULT NULL COMMENT '说明',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='签到历史';


DROP TABLE IF EXISTS `ws_member_thirdparty`;
CREATE TABLE `ws_member_thirdparty` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `type` varchar(50) DEFAULT NULL COMMENT '类型，wechat/mini/qq/自定义',
  `mark` varchar(30) DEFAULT NULL COMMENT '第三方标识，如openid',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='会员与第三方关联表';


DROP TABLE IF EXISTS `ws_member_token`;
CREATE TABLE `ws_member_token` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(16) DEFAULT NULL COMMENT '账号',
  `token` varchar(32) DEFAULT NULL COMMENT 'TOKEN',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='会员TOKEN表';


DROP TABLE IF EXISTS `ws_menu`;
CREATE TABLE `ws_menu` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '菜单名称',
  `app` varchar(1000) DEFAULT NULL COMMENT 'app，是否把菜单设为active状态，多个用逗号隔开',
  `act` varchar(1000) DEFAULT NULL COMMENT 'act',
  `param` varchar(1000) DEFAULT NULL COMMENT 'param',
  `url` varchar(250) DEFAULT NULL COMMENT '跳转地址',
  `icon` varchar(250) DEFAULT NULL COMMENT '图标',
  `sort` int(11) DEFAULT '999' COMMENT '数字越小，排在越前',
  `parent_id` int(11) DEFAULT '0' COMMENT '父id，0顶级',
  `is_menu` int(11) DEFAULT '1' COMMENT '是否菜单',
  `is_gm` int(11) DEFAULT '0' COMMENT '客户后台菜单',
  `is_ag` int(11) DEFAULT '0' COMMENT '代理后台菜单',
  `is_op` int(11) DEFAULT '0' COMMENT '总后台菜单',
  `status` int(11) DEFAULT '1' COMMENT '0隐藏，1显示',
  `edition` varchar(100) DEFAULT '2,3' COMMENT '系统功能版本',
  PRIMARY KEY (`id`),
  KEY `app` (`app`),
  KEY `act` (`act`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COMMENT='后台菜单表';


DROP TABLE IF EXISTS `ws_message`;
CREATE TABLE `ws_message` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `type` varchar(50) DEFAULT NULL COMMENT '消息类型，如goods, shop, order, offer, logistics，为空即系统',
  `content` varchar(250) DEFAULT NULL COMMENT '消息内容',
  `from_id` int(11) DEFAULT '0' COMMENT '发送人，0系统',
  `readed` int(11) DEFAULT '0' COMMENT '是否阅读，0新消息，1已阅',
  `target` varchar(1000) DEFAULT NULL COMMENT '跳转目标，如商品id，店铺id、或链接',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='消息表';


DROP TABLE IF EXISTS `ws_op_config`;
CREATE TABLE `ws_op_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '参数名称',
  `memo` varchar(255) DEFAULT NULL COMMENT '参数说明',
  `content` text COMMENT '参数值',
  `type` varchar(255) DEFAULT NULL COMMENT '参数填写方式，file上传图片，textarea文本域|占位符，[radio|checkbox|select|switch]|值1:字1#值2:字2，input文本框(默认)|占位符',
  `parent_id` int(11) DEFAULT '0' COMMENT '父id(供switch用)',
  `parent_value` varchar(255) DEFAULT NULL COMMENT '分组依据(父值,供switch用)',
  `status` int(11) DEFAULT '1' COMMENT '0隐藏，1显示',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 COMMENT='全局参数表';


DROP TABLE IF EXISTS `ws_order`;
CREATE TABLE `ws_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `shop_id` int(11) DEFAULT '0' COMMENT '订单直接销售店铺id',
  `reseller_id` int(11) DEFAULT '0' COMMENT '邀请人id',
  `type` int(11) DEFAULT '0' COMMENT '订单类型，0普通，1拼团，2秒杀，3砍价',
  `parent_id` int(11) DEFAULT '0' COMMENT '所属订单类型主id',
  `order_sn` varchar(50) DEFAULT NULL COMMENT '订单单号',
  `pay_order_sn` varchar(50) DEFAULT NULL COMMENT '订单号(重新支付时会变)',
  `parent_order_sn` varchar(50) DEFAULT NULL COMMENT '父订单SN（有分单时，需要通过此单号来记录子订单）',
  `total_price` decimal(10,2) DEFAULT '0.00' COMMENT '订单总价',
  `status` int(11) DEFAULT '0' COMMENT '0未支付，1已支付，2已发货，3完成（已收货），4完成（已评价），-1取消，-2退款，-3退货',
  `shown` int(11) DEFAULT '1' COMMENT '是否对用户显示，0隐藏，1显示',
  `add_time` int(11) DEFAULT '0' COMMENT '下单时间',
  `trade_no` varchar(200) DEFAULT NULL COMMENT '外部订单号',
  `total_fee` decimal(10,2) DEFAULT '0.00' COMMENT '支付金额',
  `pay_method` varchar(50) DEFAULT 'alipay' COMMENT 'alipay/wxpay/wxpay_h5/wxpay_mini',
  `client_type` int(11) DEFAULT '0' COMMENT '客户端类型，0网页，1小程序，2iOS，3Android',
  `pay_time` int(11) DEFAULT '0' COMMENT '付款时间',
  `shipping_time` int(11) DEFAULT '0' COMMENT '发货时间',
  `shouhuo_time` int(11) DEFAULT '0' COMMENT '收货时间',
  `ask_refund_time` int(11) DEFAULT '0' COMMENT '申请退货退款时间',
  `refund_time` int(11) DEFAULT '0' COMMENT '退货退款时间',
  `edit_time` int(11) DEFAULT '0' COMMENT '修改时间',
  `cancel_time` int(11) DEFAULT '0' COMMENT '取消时间',
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `district` varchar(50) DEFAULT NULL COMMENT '区',
  `address` varchar(250) DEFAULT NULL COMMENT '地址',
  `zipcode` varchar(10) DEFAULT NULL COMMENT '邮政编码',
  `name` varchar(50) DEFAULT NULL COMMENT '收货人姓名',
  `idcard` varchar(50) DEFAULT NULL COMMENT '身份证号码',
  `mobile` varchar(100) DEFAULT NULL COMMENT '手机号码',
  `memo` varchar(1000) DEFAULT NULL COMMENT '买家留言',
  `shipping_price` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `discount_price` decimal(10,2) DEFAULT '0.00' COMMENT '折扣',
  `shipping_company` varchar(200) DEFAULT NULL COMMENT '快递公司',
  `shipping_number` varchar(200) DEFAULT NULL COMMENT '快递单号',
  `coupon_sn` varchar(50) DEFAULT NULL COMMENT '优惠券id',
  `ip` varchar(50) DEFAULT NULL COMMENT '下单ip',
  `delay_shouhuo_time` int(11) DEFAULT '0' COMMENT '提交延迟收货时间',
  `ask_shipping_time` int(11) DEFAULT '0' COMMENT '提醒发货时间',
  `reseller_read_time` int(11) DEFAULT '0' COMMENT '渠道商是否查看了该订单',
  `factory_read_time` int(11) DEFAULT '0' COMMENT '厂家是否查看了该订单',
  `handle_after_paid` int(11) DEFAULT '0' COMMENT '是否已处理库存、发送通知等',
  `invoice_type` varchar(200) DEFAULT NULL COMMENT '发票类型，分个人/公司',
  `invoice_name` varchar(200) DEFAULT NULL COMMENT '发票抬头',
  `invoice_content` varchar(200) DEFAULT NULL COMMENT '发票内容',
  `used_commission` decimal(10,2) DEFAULT '0.00' COMMENT '使用佣金支付',
  `used_money` decimal(10,2) DEFAULT '0.00' COMMENT '使用余额支付',
  `used_coupon` decimal(10,2) DEFAULT '0.00' COMMENT '使用优惠券支付',
  `readed` int(11) DEFAULT '0' COMMENT '0未看，1已看',
  `integral_order` int(11) DEFAULT '0' COMMENT '是否积分商城订单',
  `used_integral` decimal(10,2) DEFAULT '0.00' COMMENT '使用积分抵现',
  `integral` int(11) DEFAULT '0' COMMENT '使用了多少积分',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8 COMMENT='订单表';


DROP TABLE IF EXISTS `ws_order_goods`;
CREATE TABLE `ws_order_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `shop_id` int(11) DEFAULT '0' COMMENT '店铺id',
  `order_id` int(11) DEFAULT '0' COMMENT '订单id',
  `goods_id` int(11) DEFAULT '0' COMMENT '商品id',
  `goods_name` varchar(250) DEFAULT NULL COMMENT '商品名称',
  `goods_pic` varchar(250) DEFAULT NULL COMMENT '商品主图',
  `spec_linkage` varchar(100) DEFAULT NULL COMMENT '规格id树，逗号隔开',
  `spec` varchar(200) DEFAULT NULL COMMENT '规格',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '价格(单价*数量)',
  `single_price` decimal(10,2) DEFAULT '0.00' COMMENT '单价(购买商品当时价格)',
  `quantity` int(11) DEFAULT '1' COMMENT '购买数量',
  `qrcode` varchar(250) DEFAULT NULL COMMENT '条形码/二维码',
  `comment_stars` int(11) DEFAULT '5' COMMENT '评价打分',
  `comment_pic` varchar(1000) DEFAULT NULL COMMENT '评价图片',
  `comment_content` varchar(1000) DEFAULT NULL COMMENT '评价内容',
  `comment_time` int(11) DEFAULT '0' COMMENT '评价时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=56 DEFAULT CHARSET=utf8 COMMENT='订单商品表';


DROP TABLE IF EXISTS `ws_order_refund`;
CREATE TABLE `ws_order_refund` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(11) DEFAULT '0' COMMENT '订单id',
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `shop_id` int(11) DEFAULT '0' COMMENT '店铺id',
  `pay_method` varchar(50) DEFAULT NULL COMMENT '原订单的支付方式',
  `out_refund_no` varchar(50) DEFAULT NULL COMMENT '本站退款订单号',
  `type` int(11) DEFAULT '0' COMMENT '1退款，2退货',
  `reason` varchar(500) DEFAULT NULL COMMENT '退款理由',
  `price` decimal(10,2) DEFAULT '0.00' COMMENT '退款金额',
  `memo` varchar(500) DEFAULT NULL COMMENT '退款备注',
  `pic1` varchar(250) DEFAULT NULL COMMENT '退款拍照图',
  `pic2` varchar(250) DEFAULT NULL COMMENT '退款拍照图',
  `pic3` varchar(250) DEFAULT NULL COMMENT '退款拍照图',
  `status` int(11) DEFAULT '0' COMMENT '状态，0申请，1成功',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `audit_memo` varchar(500) DEFAULT NULL COMMENT '审核理由',
  `audit_time` int(11) DEFAULT '0' COMMENT '审核时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='退款/退货表';


DROP TABLE IF EXISTS `ws_platform_auth`;
CREATE TABLE `ws_platform_auth` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '平台名称',
  `auth` varchar(32) DEFAULT NULL COMMENT '授权码',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='外部平台授权码';


DROP TABLE IF EXISTS `ws_province`;
CREATE TABLE `ws_province` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `province_id` int(11) DEFAULT '0' COMMENT '省份id',
  `name` varchar(20) DEFAULT NULL COMMENT '名称',
  PRIMARY KEY (`id`),
  KEY `province_id` (`province_id`)
) ENGINE=InnoDB AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='省份表';


DROP TABLE IF EXISTS `ws_recharge`;
CREATE TABLE `ws_recharge` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) DEFAULT NULL COMMENT '充值名称',
  `pic` varchar(250) DEFAULT NULL COMMENT '充值活动图片',
  `price` decimal(10,2) DEFAULT NULL COMMENT '充值金额',
  `recharged_money` decimal(10,2) DEFAULT NULL COMMENT '充值后总金额',
  `promotion_begin_time` int(11) DEFAULT '0' COMMENT '活动开始时间',
  `promotion_end_time` int(11) DEFAULT '0' COMMENT '活动结束时间',
  `promotion_recharged_money` decimal(10,2) DEFAULT NULL COMMENT '活动期间充值后总金额',
  `status` int(11) DEFAULT '1' COMMENT '1正常，0隐藏',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 COMMENT='充值表（分不同档次）';


DROP TABLE IF EXISTS `ws_router_log`;
CREATE TABLE `ws_router_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type` int(11) DEFAULT '0' COMMENT '位置类型，0前端，1客户后台，2代理后台，3总后台',
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `member_name` varchar(100) DEFAULT NULL COMMENT '会员名称',
  `script_name` varchar(50) DEFAULT NULL COMMENT '脚本名称',
  `app` varchar(50) DEFAULT NULL COMMENT '路由app',
  `act` varchar(50) DEFAULT NULL COMMENT '路由act',
  `query_string` varchar(250) DEFAULT NULL COMMENT '请求连接',
  `user_agent` varchar(500) DEFAULT NULL COMMENT '浏览器信息',
  `ip` varchar(50) DEFAULT NULL COMMENT 'ip地址',
  `app_version` varchar(50) DEFAULT NULL COMMENT 'app的版本',
  `api_version` varchar(50) DEFAULT NULL COMMENT 'api的版本',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='路由访问表';


DROP TABLE IF EXISTS `ws_seach_history`;
CREATE TABLE `ws_seach_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `content` varchar(250) DEFAULT NULL COMMENT '搜索内容',
  `add_time` int(11) DEFAULT '0' COMMENT '搜索时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=288 DEFAULT CHARSET=utf8 COMMENT='搜索历史';


DROP TABLE IF EXISTS `ws_shipping_company`;
CREATE TABLE `ws_shipping_company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '快递公司名称',
  `pinyin` varchar(50) DEFAULT NULL COMMENT '快递拼音，如EMS、YTO',
  `sort` int(11) DEFAULT '999' COMMENT '数字越小，排在越前',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COMMENT='快递公司表';


DROP TABLE IF EXISTS `ws_shipping_fee`;
CREATE TABLE `ws_shipping_fee` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) DEFAULT NULL COMMENT '模板名称',
  `type` int(11) DEFAULT '0' COMMENT '类型，0按重量，1按件数',
  `first` int(11) DEFAULT '0' COMMENT '首重(件)',
  `first_price` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `second` int(11) DEFAULT '0' COMMENT '续重(件)',
  `second_price` decimal(10,2) DEFAULT '0.00' COMMENT '续费',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COMMENT='运费模板';


DROP TABLE IF EXISTS `ws_shipping_fee_area`;
CREATE TABLE `ws_shipping_fee_area` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `shipping_fee_id` int(11) DEFAULT '0' COMMENT '运费模板id',
  `districts` text COMMENT '区域id',
  `first` int(11) DEFAULT '0' COMMENT '首重(件)',
  `first_price` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `second` int(11) DEFAULT '0' COMMENT '续重(件)',
  `second_price` decimal(10,2) DEFAULT '0.00' COMMENT '续费',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=15 DEFAULT CHARSET=utf8 COMMENT='运费模板配送区域';


DROP TABLE IF EXISTS `ws_shop`;
CREATE TABLE `ws_shop` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(250) DEFAULT NULL COMMENT '店铺名称',
  `member_id` int(11) DEFAULT '0' COMMENT '所属会员',
  `avatar` varchar(250) DEFAULT NULL COMMENT '店铺头像',
  `poster_pic` varchar(250) DEFAULT NULL COMMENT '店铺店招图片',
  `goods` int(11) DEFAULT '0' COMMENT '商品数量',
  `resellers` int(11) DEFAULT '0' COMMENT '渠道商数量',
  `followers` int(11) DEFAULT '0' COMMENT '关注者数量',
  `clicks` int(11) DEFAULT '0' COMMENT '店铺被访问的次数',
  `province` varchar(50) DEFAULT NULL COMMENT '联系地址-省',
  `city` varchar(50) DEFAULT NULL COMMENT '联系地址-市',
  `district` varchar(50) DEFAULT NULL COMMENT '联系地址-区',
  `address` varchar(250) DEFAULT NULL COMMENT '联系地址-地址',
  `mobile` varchar(100) DEFAULT NULL COMMENT '手机',
  `tel` varchar(250) DEFAULT NULL COMMENT '固定电话',
  `qq` varchar(100) DEFAULT NULL,
  `weixin` varchar(100) DEFAULT NULL,
  `email` varchar(250) DEFAULT NULL,
  `contacter` varchar(50) DEFAULT NULL COMMENT '联系人/法人',
  `type_id` int(11) DEFAULT '0' COMMENT '主营类目',
  `shop_type` int(11) DEFAULT '0' COMMENT '店铺类型，1渠道商店铺（不显示），2厂家店铺',
  `status` int(11) DEFAULT '0' COMMENT '-1冻结，0等待审核，1正常',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `audit_time` int(11) DEFAULT '0' COMMENT '审核时间',
  `description` varchar(500) DEFAULT NULL COMMENT '店铺简介',
  `return_province` varchar(50) DEFAULT NULL COMMENT '退货地址-省',
  `return_city` varchar(50) DEFAULT NULL COMMENT '退货地址-省',
  `return_district` varchar(50) DEFAULT NULL COMMENT '退货地址-省',
  `return_address` varchar(50) DEFAULT NULL COMMENT '退货地址-省',
  `return_name` varchar(50) DEFAULT NULL COMMENT '退货地址-联系人',
  `return_mobile` varchar(50) DEFAULT NULL COMMENT '退货地址-电话',
  `orders` int(11) DEFAULT '0' COMMENT '店铺订单总数',
  `week_orders` int(11) DEFAULT '0' COMMENT '7天订单数',
  `total_income` decimal(10,2) DEFAULT '0.00' COMMENT '总收入',
  `week_income` decimal(10,2) DEFAULT '0.00' COMMENT '周收入',
  `can_withdraw_money` decimal(11,2) DEFAULT '0.00' COMMENT '可提取的金额',
  `withdrawed_money` decimal(11,2) DEFAULT '0.00' COMMENT '已结算的金额',
  `withdrawing_money` decimal(11,2) DEFAULT '0.00' COMMENT '正在结算的金额',
  `longitude` double DEFAULT '0' COMMENT '纬度',
  `latitude` double DEFAULT '0' COMMENT '经度',
  `sort` int(11) DEFAULT '999' COMMENT '数字越小，排在越前',
  `wifi` int(11) DEFAULT '1' COMMENT '免费WIFI',
  `pickup` int(11) DEFAULT '0' COMMENT '门店取货',
  `app_discount` decimal(10,1) DEFAULT '0.0' COMMENT 'APP下单折扣',
  `business_time` varchar(250) DEFAULT NULL COMMENT '营业时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺表';


DROP TABLE IF EXISTS `ws_shop_apply`;
CREATE TABLE `ws_shop_apply` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `type_id` int(11) DEFAULT '0' COMMENT '申请类型',
  `type_sub` int(11) DEFAULT '0' COMMENT '二级类型',
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `name` varchar(50) DEFAULT NULL COMMENT '店铺名称',
  `contacter` varchar(50) DEFAULT NULL COMMENT '法人',
  `mobile` varchar(50) DEFAULT NULL COMMENT '电话',
  `province` varchar(50) DEFAULT NULL COMMENT '省',
  `city` varchar(50) DEFAULT NULL COMMENT '市',
  `district` varchar(50) DEFAULT NULL COMMENT '区',
  `address` varchar(100) DEFAULT NULL COMMENT '店铺地址',
  `reason` varchar(1000) DEFAULT NULL COMMENT '申请说明',
  `idcard_pic1` varchar(250) DEFAULT NULL COMMENT '身份证正面',
  `idcard_pic2` varchar(250) DEFAULT NULL COMMENT '身份证反面',
  `business_license_pic` varchar(250) DEFAULT NULL COMMENT '营业执照图片',
  `license_pic` varchar(250) DEFAULT NULL COMMENT '许可证图片',
  `other_pic` varchar(250) DEFAULT NULL COMMENT '其他图片',
  `remark` varchar(1000) DEFAULT NULL COMMENT '审核备注',
  `status` int(11) DEFAULT '0' COMMENT '审核状态',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='店铺申请表';


DROP TABLE IF EXISTS `ws_sms`;
CREATE TABLE `ws_sms` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `mobile` varchar(50) DEFAULT NULL COMMENT '手机号码',
  `content` varchar(250) DEFAULT NULL COMMENT '短信内容',
  `ip` varchar(50) DEFAULT NULL COMMENT 'ip地址，可以用来记录提交短信的ip，限制发送频率',
  `add_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `status` int(11) DEFAULT '0' COMMENT '0未发送，1已发送',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=47 DEFAULT CHARSET=utf8 COMMENT='短信发送记录表';


DROP TABLE IF EXISTS `ws_town`;
CREATE TABLE `ws_town` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `town_id` bigint(20) DEFAULT '0' COMMENT '街道id',
  `name` varchar(40) DEFAULT NULL COMMENT '名称',
  `parent_id` int(11) DEFAULT '0' COMMENT '上级id',
  PRIMARY KEY (`id`),
  KEY `town_id` (`town_id`)
) ENGINE=InnoDB AUTO_INCREMENT=44389 DEFAULT CHARSET=utf8 COMMENT='街道表';


DROP TABLE IF EXISTS `ws_withdraw`;
CREATE TABLE `ws_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `member_id` int(11) DEFAULT '0' COMMENT '会员id',
  `shop_id` int(11) DEFAULT '0' COMMENT '店铺id',
  `order_sn` varchar(50) DEFAULT NULL COMMENT '订单号',
  `trade_no` varchar(250) DEFAULT NULL COMMENT '外部订单号',
  `pay_method` varchar(50) DEFAULT 'wxpay_h5' COMMENT 'alipay/wxpay/wxpay_h5',
  `client_type` int(11) DEFAULT '0' COMMENT '客户端类型，0网页，1小程序，2iOS，3Android',
  `pay_time` int(11) DEFAULT '0' COMMENT '付款时间',
  `withdraw_money` decimal(10,2) DEFAULT '0.00' COMMENT '提现金额',
  `name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `bank_name` varchar(50) DEFAULT NULL COMMENT '银行名称',
  `bank_branch` varchar(100) DEFAULT NULL COMMENT '支行名称',
  `bank_card` varchar(50) DEFAULT NULL COMMENT '银行卡号',
  `alipay` varchar(50) DEFAULT NULL COMMENT '支付宝账号',
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `add_time` int(11) DEFAULT '0' COMMENT '提现申请日期',
  `person_income` int(11) DEFAULT '0' COMMENT '个人所得税',
  `invoice_number` varchar(200) DEFAULT NULL COMMENT '发票单号',
  `shipping_number` varchar(200) DEFAULT NULL COMMENT '快递单号',
  `shipping_company` varchar(200) DEFAULT NULL COMMENT '快递公司',
  `ip` varchar(50) DEFAULT NULL COMMENT '提现人ip',
  `type` varchar(20) DEFAULT 'commission' COMMENT '资金来源(member表的字段)，commission佣金',
  `status` int(11) DEFAULT '0' COMMENT '0等待审单，1审单成功，2提现成功，-1审单失败，-2提现失败',
  `audit_memo` varchar(250) DEFAULT NULL COMMENT '审核备注',
  `audit_adminid` int(11) DEFAULT '0' COMMENT '审单人ID',
  `audit_admin` varchar(50) DEFAULT NULL COMMENT '审单人',
  `audit_time` int(11) DEFAULT '0' COMMENT '审单时间',
  `withdraw_memo` varchar(250) DEFAULT NULL COMMENT '提现结果的备注，如流水号',
  `withdraw_adminid` int(11) DEFAULT '0' COMMENT '提现操作人ID',
  `withdraw_admin` varchar(50) DEFAULT NULL COMMENT '提现操作人',
  `withdraw_time` int(11) DEFAULT '0' COMMENT '提现操作时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='提现表';


